                </div>

                <div className='header-inner'>
                    <h5 className='Name'>{userName}</h5>
                    <button className='header-button' type="button" onClick={handleGoBack}>Выйти</button>
                </div>
            </div>

        </div>
        );
}

export default CurseDetails;
